import { useEffect, useState } from "react"
import PointForecast from "../pagesComponents/homePageComponents/PointForecast.js";
import Points from "../pagesComponents/homePageComponents/Points.js"
import { getPoints } from "../services/API.js";

export default function HomePage() {
    const [pointList, setPointsList] = useState([]);
    const [selectedPoint, setSelectedPoint] = useState(0);
    const [latitude, setLatitude] = useState('');
    const [longitude, setLongitude] = useState('');

    useEffect(() => {
        getPoints().then((response) => {
            setPointsList(response.data);
        }).catch((error) => {
            console.log(error);
        });
    }, []);
    console.log(latitude,longitude);

    return (
        <>
            <div>HomePage</div>
            {selectedPoint === 0 ? <>
                {pointList.map((point, index) => (
                    <Points
                        key={index}
                        name={point.name}
                        id={point.id}
                        setSelectedPoint={setSelectedPoint}
                        setLatitude={setLatitude}
                        setLongitude={setLongitude}
                        latitude={point.latitude}
                        longitude={point.longitude}
                    />
                ))} </> :
                <PointForecast
                selectedPoint={selectedPoint}
                />
            }
        </>
    )
}
